import { useState, useEffect } from "react";
import { Card, CardContent } from "@/components/ui/card";
import { Button } from "@/components/ui/button";
import { Input } from "@/components/ui/input";
import { Table } from "@/components/ui/table";
import { Dialog, DialogTitle, DialogContent, DialogFooter } from "@/components/ui/dialog";
import { Plus, Trash, Edit } from "lucide-react";

export default function BranchManagement() {
  const [branches, setBranches] = useState([]);
  const [search, setSearch] = useState("");
  const [openDialog, setOpenDialog] = useState(false);
  const [branchData, setBranchData] = useState({ id: null, name: "", location: "", phone: "" });

  useEffect(() => {
    fetchBranches();
  }, []);

  const fetchBranches = async () => {
    try {
      const response = await fetch("/api/branches");
      const data = await response.json();
      setBranches(data);
    } catch (error) {
      console.error("Error fetching branches:", error);
    }
  };

  const handleSaveBranch = async () => {
    try {
      const method = branchData.id ? "PUT" : "POST";
      const url = branchData.id ? `/api/branches/${branchData.id}` : "/api/branches";
      await fetch(url, {
        method,
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(branchData),
      });
      fetchBranches();
      setOpenDialog(false);
      setBranchData({ id: null, name: "", location: "", phone: "" });
    } catch (error) {
      console.error("Error saving branch:", error);
    }
  };

  const handleDelete = async (id) => {
    try {
      await fetch(`/api/branches/${id}`, { method: "DELETE" });
      fetchBranches();
    } catch (error) {
      console.error("Error deleting branch:", error);
    }
  };

  const handleEdit = (branch) => {
    setBranchData(branch);
    setOpenDialog(true);
  };

  return (
    <div className="p-4 space-y-4">
      <h1 className="text-2xl font-bold">จัดการสาขา</h1>
      <div className="flex gap-2">
        <Input placeholder="ค้นหาสาขา..." value={search} onChange={(e) => setSearch(e.target.value)} />
        <Button onClick={() => setOpenDialog(true)}><Plus size={16} /> เพิ่มสาขา</Button>
      </div>
      <Card>
        <CardContent>
          <Table>
            <thead>
              <tr>
                <th>ชื่อสาขา</th>
                <th>ที่อยู่</th>
                <th>เบอร์ติดต่อ</th>
                <th>จัดการ</th>
              </tr>
            </thead>
            <tbody>
              {branches.filter(b => b.name.includes(search)).map((branch) => (
                <tr key={branch.id}>
                  <td>{branch.name}</td>
                  <td>{branch.location}</td>
                  <td>{branch.phone}</td>
                  <td>
                    <Button variant="ghost" size="sm" onClick={() => handleEdit(branch)}><Edit size={16} /></Button>
                    <Button variant="ghost" size="sm" onClick={() => handleDelete(branch.id)}><Trash size={16} /></Button>
                  </td>
                </tr>
              ))}
            </tbody>
          </Table>
        </CardContent>
      </Card>
      {/* Dialog for Adding / Editing Branch */}
      <Dialog open={openDialog} onOpenChange={setOpenDialog}>
        <DialogTitle>{branchData.id ? "แก้ไขสาขา" : "เพิ่มสาขา"}</DialogTitle>
        <DialogContent>
          <Input placeholder="ชื่อสาขา" value={branchData.name} onChange={(e) => setBranchData({ ...branchData, name: e.target.value })} />
          <Input placeholder="ที่อยู่" value={branchData.location} onChange={(e) => setBranchData({ ...branchData, location: e.target.value })} />
          <Input placeholder="เบอร์ติดต่อ" value={branchData.phone} onChange={(e) => setBranchData({ ...branchData, phone: e.target.value })} />
        </DialogContent>
        <DialogFooter>
          <Button onClick={handleSaveBranch}>{branchData.id ? "บันทึกการเปลี่ยนแปลง" : "เพิ่มสาขา"}</Button>
        </DialogFooter>
      </Dialog>
    </div>
  );
}
